angular.module("grGridBoard").run(["$templateCache",function(a){"use strict";a.put("gr-grid-board-template",'<svg xmlns="http://www.w3.org/2000/svg" ng-attr-viewBox="{{viewBox}}">\n	<rect \n		ng-repeat="pos in positions"\n		class="gr-grid-rect gr-grid-rect-{{pos.line}}x{{pos.column}}"\n		ng-class="{selected: values[pos.line][pos.column], unselected: !values[pos.line][pos.column]}"\n		ng-click="clickRect(pos.line, pos.column)"\n		ng-attr-x="{{pos.x}}" ng-attr-y="{{pos.y}}">\n	</rect>\n</svg>')}]);